  width: "100%",
  height: "400px",
  backgroundImage: `url(${Logo})`
};

function Home() {
  return (
      <div>
   <Hero style={ sectionStyle }>
       <p>hello</p>
   </Hero>
   </div>
  );
}

export default Home;
